    float expectedRoll = NormalizeAngle([[samples lastObject][@"coreMotionRoll"] floatValue]);
    float expectedPitch = NormalizeAngle([[samples lastObject][@"coreMotionPitch"] floatValue]);
    float expectedYaw = NormalizeAngle([[samples lastObject][@"coreMotionYaw"] floatValue]);
    
